import './homePanel.css'


const HomePanel=()=>{


  return(
    <>
      <h1>Главная страница</h1>
      <NavLink  style={({isActive})=>({color:isActive?'#9f0013':'inherit'})} to="/exchange">Exchange Rates</NavLink>
    </>
  )
}
export default HomePanel;
